import React from 'react';

import {Footer, Blog, Possibility, Features,hatgpt3, Header } from './containers';
import{Cta, Navbar, Brand} from './components';

const App = () => {
  return (
    <div className='App'>
        <div className='gradient__bg'>
          <Navbar />
          <Header />
        </div>
        <Brand />
        <whatgpt3 />
        <Features />
        <Possibility />
        <Cta />
        <Blog />
        <Footer />
    </div>
  )
}

export default App
